import { Component } from "react";

export class Statistic extends Component {
    


    render (){
    return (
        <>
        <button type="submit" name="good" onClick={ (e) => this.props.incrementValue(e) }> Good </button>
        <button type="submit" name="neutral" onClick={ (e) => this.props.incrementValue(e) }> Neutral </button>
        <button type="submit" name="bad" onClick={ (e) => this.props.incrementValue(e) }> Bad </button>

        <h2> Statistic </h2>

        <p>Good: {this.props.good}</p>
        <p>Neutral: {this.props.neutral}</p>
        <p>Neutral: {this.props.bad}</p>
        <p>Total: {this.props.total}</p>
        <p>Positive feedback: {this.props.total}</p>
        </>
    ); 
    }
}


